import React from 'react';

import HomeScreen from './screens/HomeScreen'
import LoginScreen from './screens/LoginScreen'
import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route
} from "react-router-dom"
function App() {
  return (
  <div className="App" style={{backgroundColor:'#111'}}>
    
    <Router>
      <Switch>
        <Route path="/">
          <HomeScreen/>
        </Route>
      </Switch>
    </Router>
  </div>
  );
}

export default App;
